            position: relative;
            height: 100vh;
            width: 100%;
            justify-content: center;
            align-items: center;
            /* background-image: radial-gradient(rgb(249, 252, 253), rgb(168, 208, 245)); */

        .img-back {
            background: #e6ecff;
            width: 100%;
            height: 100vh;
            overflow: hidden;
        }
        .img-fornt {
            /* display: flex;
            flex-flow: column nowrap;
            justify-content: center;
            align-items: center; */
            position: fixed;
            width: 100vw;
            max-width: 1000px;
            animation-iteration-count: infinite;
            animation-direction: alternate;
        }
        .img-pic {
            width: 100%;
            /* border: 1px solid rgba(0, 0, 0, 0.089); */
        }
        @keyframes transform {
            0% {
                transform: translate(-10px, -70px);
            }

            100% {
                transform: translate(-10px, 0);
                /* box-shadow: 0 25px 15px rgb(245, 245, 245); */
            }
        }
